import React from 'react'
import { List, ListItem, ListItemText } from '@material-ui/core';

function Todo({todo}) {
    return (
        <List>
            <ListItem>
                <ListItemText primary="todo" secondary={todo}></ListItemText>
            </ListItem>
            <li>{todo}</li>
        </List>
    )
}

export default Todo;
